import {useState} from 'react';
import {
	TextField,
	Button,
	// styled,
	Table,
	TableBody,
	TableCell,
	TableContainer,
	TableHead,
	TableRow,
	Paper
} from '@mui/material';


const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

function createData(Name, Edit, Delete) {
  return { Name, Edit, Delete, };
}





function TodoList(){


	const [data, setData] = useState([
		{
		  name: 'list 1'  
		},{
		  name: 'list 2'
		},{
		  name: 'list 3'
		},{
		  name: 'list 4'
		} 
	]);

	const editButton = <Button style= {{ }} variant="contained" onClick={()=>alert(1)}>Edit</Button>

	const rows = [
	  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
	  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
	  createData('Eclair', 262, 16.0, 24, 6.0),
	  createData('Cupcake', 305, 3.7, 67, 4.3),
	  createData('Gingerbread', 356, 16.0, 49, 3.9),
	];


	return(
		<>
			<center><h1>Todo List</h1></center>
			<div style={{'display': 'inline','padding': '1em'}} >
			  <TextField 
			  	style= {{ 'marginRight': '1em' }}
			  	id="outlined-basic" 
			  	label="List" 
			  	variant="outlined"
			  	size="small"
			  	/>
			  <Button style= {{ }} variant="contained" onClick={()=>alert(1)}>Add</Button>
			  {editButton}
			</div>
			<br/><br/>
			<ul>
			{
				data.map((item,i) => {
				  return <li>{item.name}</li>
				})
			}
			</ul>
		</>
	);
}

export default TodoList;
